import pool from "../configs/connectDB"
import multer from "multer";
// import path from "path";

let getHomepage = async(req,res)=>{ 
   const [rows, fields] = await pool.execute('SELECT * FROM users ');
   return res.render('index.ejs',{dataUser:rows,test:"jezztom string test"}  );
   
}
    //console.log("checkdata >>>>",typeof (data),JSON.stringify(data)); 

let getDetailpage = async   (req,res)=>{
    let userid = req.params.id;
    let [user] = await pool.execute('select * from users where id = ?',[userid]);
    //console.log('check request params',user);
    return res.send(JSON.stringify(user))
}
let getAboutpage = (req,res)=>{
    return res.send('hello about page')
}

let createNewUser = async(req,res) =>{
    console.log(req.body);
    let {firstname,lastname,email,address} = req.body;
    await pool.execute('insert into users (firstname,lastname,email,address) values (?,?,?,?)',[firstname,lastname,email,address])
    return res.redirect('/homepage');

}
let deleteUser = async(req,res)=>{
    let userId = req.body.userId;
    await pool.execute('delete from users where id = ?',[userId]);
    //return res.send(` delete user ${req.body.userId} `)
    //alert('deleted successfully')
    return res.redirect('/homepage');
}
let getEditpage = async(req,res)=>{
    //let userID = req.body.userId;
    //await pool.execute('update from users where id = ?',[userId]);
    
    //alert('deleted successfully')
    let id = req.params.id;
   // console.log('userid : >>>>>',userid)
    let [user] = await pool.execute('select * from users where id = ?',[id]);
    console.log('user : ',user)
    return res.render('update.ejs',{dataUser:user[0]});
    //return res.send(` delete user ${req.params.id} `)
}
let updateUser = async(req,res)=>{
     //let id = req.body.userId;

     let {firstname,lastname,email,address,id} = req.body;
     await pool.execute('update users set firstname = ?,lastname = ?,email=?,address=? where id = ?',[firstname,lastname,email,address,id]);
    // //return res.send(` delete user ${req.body.userId} `)
    // //alert('deleted successfully')
    return res.redirect('/homepage');
}


let getUploadFilePage = async (req, res) => {
    return res.render('uploadFile.ejs')
};
const upload = multer().single('profile_pic');
//const uploadMulti = multer().array('multiple_images', 3)
let handleUploadFile = async (req, res) => {
    // 'profile_pic' is the name of our file input field in the HTML form
    console.log(req.file);
     upload(req, res, function (err) {
        // req.file contains information of uploaded file
        // req.body contains information of text fields, if there were any

        if (req.fileValidationError) {
            return res.send(req.fileValidationError);
        }
        else if (!req.file) {
            return res.send('Please select an image to upload');
        }
        else if (err instanceof multer.MulterError) {
            return res.send(err);
        }
        else if (err) {
            return res.send(err);
        }

        // Display uploaded image for user validation
        res.send(`You have uploaded this image: <hr/><img src="/image/${req.file.filename}" width="500"><hr /><a href="/uploadfile">Upload another image</a>`);
     });
}
let uploadMultipleFile = async(req,res) =>{
    
    // uploadMulti(req, res, function(err) {
        if (req.fileValidationError) {
            return res.send(req.fileValidationError);
        }
        else if (!req.files) {
            return res.send('Please select an image to upload');
        }
        // else if (err instanceof multer.MulterError) {
        //     return res.send(err);
        // }
        // else if (err) {
        //     return res.send(err);
        // }

        let result = "You have uploaded these images: <hr />";
        const files = req.files;
        console.log('check file : >>>>>',files)
        let index, len;

        // Loop through all the uploaded images and display them on frontend
        for (index = 0, len = files.length; index < len; ++index) {
            result += `<img src="/image/${files[index].filename}" width="300" style="margin-right: 20px;">`;
        }
        result += '<hr/><a href="/uploadfile">Upload more images</a>';
        res.send(result);
    // });
}
module.exports ={
    getHomepage,
    getAboutpage,
    getDetailpage,
    createNewUser,
    deleteUser,
    getEditpage,
    updateUser,
    getUploadFilePage,
    handleUploadFile,
    uploadMultipleFile 
    

}

